import React, { useState, useEffect } from "react";
import './IndexBody.css';
import topImage from "../../images/image_home_1.jpg";

export default function IndexBody() {
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        const img = new Image();
        img.src = topImage;
        img.onload = () => {
            setLoaded(true);
        };
    }, []);

    return (
        <>
            <div id="container">
                <div className={`top-part ${loaded ? 'loaded' : ''}`}>
                    <img className="top_image" src={topImage} alt="NON VA NULLA EHEAD" />
                    <div className="top-part-text">

                    </div>
                </div>
            </div>
        </>
    );
}
